import { Button, DangerButton } from "./Style";
import React, { useState } from "react";

export const HomePage = () => {
  const [clicks, setClicks] = useState(0);
  return (
    <>
      <p>{clicks}</p>
      <DangerButton onclick={setClicks(clicks + 1)}>Don't CLick</DangerButton>
    </>
  );
};
